import React, { Component } from "react"
import styled from "styled-components"

const HeroWrapper = styled.div`
  height: 100vh;
  background-color: #d499b9;
  color: #011638

`

export default class Hero extends Component {
  render() {
    return (
      <>
        <HeroWrapper></HeroWrapper>
      </>
    )
  }
}
